 	<li style="font-weight: 400;"><span style="font-weight: 400;">Создайте сайт-визитку на основе WP. Возьмите нашу верстку или используйте свою. </span></li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Сайт должен иметь страницы:</span>
<ol>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">О сервисе - показывает статичную страницу с обычным текстом описания сервиса</span></li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Список акций и список новостей. Акции разбиты по категориям. Новости не имеют категорий. Акции имеют особое поле - небольшое описание, которое содержит сокращенный текст для отображения на главной странице.</span></li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Просмотр одной акции или новости. Каждая акция или новость может иметь картинку. Должна присутствовать навигация на прошлую или следующую акцию c небольшим описанием.</span></li>
</ol>
</li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Сайт должен использовать облако тегов</span></li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Сайт должен иметь календарь в sidebar, содержащий сообщения на эти даты. Календарь - это блок цифр от 1 до 31, с ссылками, ведущими на сообщения опубликованные в эту дату. Можно использовать любой плагин или реализовать функционал самостоятельно</span></li>
 	<li style="font-weight: 400;"><span style="font-weight: 400;">Сайт должен иметь работающий поиск по акциям и список новостей</span></li>
</ol>', 'Информация', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2018-04-22 23:32:15', '2018-04-22 20:32:15', '', 0, 'http://localhost:8080/?page_id=2', 0, 'page', '', 0);
